        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "心率变异性，也称为HRV，代表了每次心跳之间时间的差异。因此，虽然您的心率衡量的是您的心每分钟跳动多少次，但HRV则是这些心跳之间时间的差异。"),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "您的心率变异性是您能够有效处理和从压力中恢复的重要表达，无论是身体压力源（如运动或疾病）还是情绪和心理压力源（如焦虑）。增加您的心率变异性意味着更好的睡眠，减轻疼痛，提高您的整体健康和健身水平。"),
        "workouts_detail_info_hrv_content3_1":
            MessageLookupByLibrary.simpleMessage(
                "您的个体心率变异性由您的HRV得分表示。通常以毫秒为单位测量HRV，较高的HRV得分表示更健康。"),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "要了解为什么高的HRV得分是身体健康的指标，您必须知道心率变异性是由自主神经系统（或ANS）控制的。自主神经系统调节身体的非自主功能（如消化、血压、呼吸和心率），由两个分支组成——交感神经系统（“战斗或逃跑模式”）和副交感神经系统（“休息、消化和恢复模式”）。"),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "交感神经系统，通常被称为“战斗或逃跑”模式，在您的身体感知到威胁时会不自觉地被激活。为了保护自己，身体利用交感神经系统加速呼吸，增加血压，并提高皮质醇等应激激素的水平，确保您拥有在危险情况下保持安全所需的所有能量和资源。"),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "副交感神经系统，通常被称为“休息和消化”模式，是一种放松状态。它减缓您的心率，减慢呼吸，并允许您的身体返回到稳态（自然平衡）。当您处于副交感神经状态时，您的身体感到安全，重新分配血流和能量以进行恢复功能，如睡眠、消化和繁殖。"),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "因此，心跳之间的时间变化大，即心率变异性高，意味着您的自主神经系统能够通过启动交感神经系统有效应对应激情况，然后在威胁消失时切换到放松的副交感神经状态。"),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "训练强度和恢复评估：通过监测心率变异性，可以更准确地了解运动员的身体疲劳程度和恢复情况。较低的HRV可能意味着身体处于过度训练或者恢复不足的状态，提示需要调整训练计划，增加恢复时间或采用低强度训练来避免过度疲劳。"),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "心理压力与体能表现关联：长期的精神压力可能导致HRV下降，影响运动表现。因此，维持良好的心率变异性有助于保持最佳的心理和生理状态，从而提高竞技水平。"),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "综上所述，心率变异性对于指导个人运动训练、监控身体健康状况及预测运动表现等方面具有重要的参考价值。通过追踪和分析HRV的变化，个体能够更好地了解自己的身体状况，并据此作出科学合理的运动决策。"),
